import React from 'react';
import './scss/app.scss';
import Header from '../src/components/Header.jsx';
import Categories from '../src/components/Categories.jsx';
import Sort from '../src/components/Sort.jsx';
import PizzaBlock from '../src/components/PizzaBlock.jsx';

function App() {
  return (
    <div class="wrapper">
      <Header />
      <div class="content">
        <div class="container">
          <div class="content__top">
            <Categories />
            <Sort />
          </div>
          <h2 class="content__title">Все пиццы</h2>
          <div class="content__items">
            <PizzaBlock />
            <PizzaBlock />
            <PizzaBlock />
            <PizzaBlock />
            <PizzaBlock />
            <PizzaBlock />
            <PizzaBlock />
            <PizzaBlock />
            <PizzaBlock />
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
